import React from "react";
import Card from 'react-bootstrap/Card';
import CardGroup from 'react-bootstrap/CardGroup';
import imageFiles from "./GalleryFiles";
import { useState } from 'react';
const Gallery=()=>{

  const [items, setItem]=useState(imageFiles);
    return(
      <>
        <div className="container-fluid nav-bg bg-color:black">
<div className="row">
<div className="col-10 mx-auto">
  <div className="col-md-12 pt-5 pt-lg-0 order-2 order-1 my-2"></div>
    <CardGroup>
      {
items.map((elem)=>{
   const{id,image,name,description} = elem;
<Card>
        <Card.Img variant="top" src={image} />
        <Card.Body>
          <Card.Title>{name}</Card.Title>
          <Card.Text>
            {description}
          </Card.Text>
        </Card.Body>
        <Card.Footer>
          <small className="text-muted">Last updated 3 mins ago</small>
        </Card.Footer>
      </Card>

})

      }
      
    
    </CardGroup>
</div>
</div>
</div>

      </>
    );
    }
    
    export default Gallery;
